import {  BrowserRouter, Link, Route, Routes } from 'react-router-dom';
import Home from './components/Home/Home';
import './App.css';

function App() {
  return (
    <div className="App">
      <BrowserRouter>

      <Routes>
      <Route path='/' element={<Home />}/>

      </Routes>
      </BrowserRouter>

    </div>
  );
}

export default App;
